import React from 'react';

import {
  ItemContainer,
  ItemInfo,
  ItemImage,
  Title,
  Text
} from 'src/components/LocationsContainer/LocationItem/styles';

const ResidentItem = ({ resident }) => {
  return (
    <>
      <ItemContainer background="#073955">
        <ItemImage>
          <img src={resident.image} alt={resident.type} />
        </ItemImage>
        <ItemInfo>
          <>
            <Title>{resident.name}</Title>
            <Text>{resident.type}</Text>
            <Text>{resident.type}</Text>
          </>
        </ItemInfo>
      </ItemContainer>
    </>
  );
};

export default ResidentItem;
